// https://leetcode.com/problems/increasing-triplet-subsequence/description/?envType=study-plan-v2&envId=leetcode-75

var increasingTriplet = function(nums) {
    let sequence = [nums[0]];
    let pivot = 0;
    for (i = 1; i < nums.length; null) {
        console.log(i, pivot, sequence)
        if (nums[i] > sequence[sequence.length - 1]) {
            sequence.push(nums[i]);
        } else if (sequence.length > 1 && nums[i] > sequence[sequence.length - 2]) {
            sequence.pop();
            sequence.push(nums[i]);
        } else if (pivot === 0) {
            pivot = i;
        }

        if (sequence.length > 2) {
            return true;
        }
        i++;
        if (i > nums.length - 1 && pivot !== 0) {
            i = pivot + 1;
            sequence = [nums[pivot]];
            pivot = 0;
        }
    }

    return false;
};


